  \"2016-11-25T21:06:14.949170\",\n\t\"name\": \"dropout-prevention-services-and-programs\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Dropout Prevention Services and Programs
  (FRSS 99), is a study that is part of the Fast Response Survey System (FRSS) program;
  program data is available since 1998-99 at <http://nces.ed.gov/surveys/frss/downloads.asp>.
  FRSS 99 (http://nces.ed.gov/surveys/frss/index.asp) is a sample survey that provides
  national estimates on how public school districts identify students at risk of dropping
  out, programs used specifically to address the needs of students at risk of dropping
  out of school, the use of mentors for at-risk students, and efforts to encourage
  dropouts to return to school. The study was conducted using mail, surveys via the
  web, and telephone follow-up for survey nonresponse and data clarification. Superintendents
  of public school districts were sampled. The study's weighted response rate was
  89 percent. Key statistics produced from FRSS 99 were information on various services
  or programs offered by districts specifically to address the needs of students at
  risk of dropping out of school, and types of transition support services used to
  help all students transition from a school at one instructional level to a school
  at a higher instructional level. Data on the various factors used to identify students
  who were at risk of dropping out were also collected.\",\n\t\"license_title\": \"Creative
